"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[1477],{10:function(e){e.exports=JSON.parse('{"blogPosts":[{"id":"Vulnerability Research","metadata":{"permalink":"/blog/Vulnerability Research","source":"@site/blog/2022-03-06-Vulnerability Research.md","title":"Vulnerability Research","description":"Categories of vulnerabilities","date":"2022-03-06T00:00:00.000Z","formattedDate":"March 6, 2022","tags":[{"label":"English","permalink":"/blog/tags/english"},{"label":"Vulnerabilities","permalink":"/blog/tags/vulnerabilities"}],"readingTime":0.455,"truncated":false,"authors":[{"name":"NENmSIS","title":"Learner","url":"https://NENmSIS.github.io","imageURL":"/img/avatargithub.jpg","key":"NENmSIS"}],"frontMatter":{"slug":"Vulnerability Research","title":"Vulnerability Research","authors":"NENmSIS","tags":["English","Vulnerabilities"]},"nextItem":{"title":"File-system permissions","permalink":"/blog/File-system permissions"}},"content":"### Categories of vulnerabilities \\r\\n\\r\\n* Operating System: found within Operating Systems (OSs).\\r\\n* (Mis)Configuration-based: incorrectly configured application or service.\\r\\n* Weak or Default Credentials: Applications and services that have an element of authentication will come with default credentials when installed.\\r\\n* Application Logic: the result of poorly designed applications. \\r\\n* Human-Factor: vulnerabilities that leverage human behaviour.\\r\\n\\r\\n### Scoring vulnerabilities\\r\\n* Common Vulnerability Scoring System (CVSS)\\r\\n* Vulnerability Priority Rating (VPR)\\r\\n\\r\\n### Vulnerability databases\\r\\n* [NVD](https://nvd.nist.gov/vuln/full-listing)\\r\\n* [Exploit Database](https://www.exploit-db.com/)\\r\\n\\r\\n### Finding manual exploits\\r\\n* [Rapid7](https://www.rapid7.com/db/)\\r\\n* [Github](https://github.com/)\\r\\n* **searchsploit** on kali, offline"},{"id":"File-system permissions","metadata":{"permalink":"/blog/File-system permissions","source":"@site/blog/2022-01-11-Unix file-system permissions.md","title":"File-system permissions","description":"This is an interesting topic to talk about with the aim of understanding the Unix permissions.","date":"2022-01-11T00:00:00.000Z","formattedDate":"January 11, 2022","tags":[{"label":"English","permalink":"/blog/tags/english"},{"label":"Linux","permalink":"/blog/tags/linux"}],"readingTime":1.18,"truncated":false,"authors":[{"name":"NENmSIS","title":"Learner","url":"https://NENmSIS.github.io","imageURL":"/img/avatargithub.jpg","key":"NENmSIS"}],"frontMatter":{"slug":"File-system permissions","title":"File-system permissions","authors":"NENmSIS","tags":["English","Linux"]},"prevItem":{"title":"Vulnerability Research","permalink":"/blog/Vulnerability Research"},"nextItem":{"title":"Bienvenidos","permalink":"/blog/Bienvenidos"}},"content":"This is an interesting topic to talk about with the aim of understanding the Unix permissions.\\r\\n\\r\\n## Notation of traditional Unix permissions\\r\\n\\r\\n## Symbolic notation\\r\\n\\r\\nThe most common form, as used by the following command, is symbolic notation. \\r\\n``` \\r\\nls -l \\r\\n```\\r\\nThe firs set represents the *user* class. The second set represents the *group* class. The third set represents the *others* class.\\r\\nEach of the three characters represent the read, write and execute permissions.\\r\\n* *r* if reading is permitted, - if is not\\r\\n* *w* if writting is permitted, - if is not\\r\\n* *x* if execution is permitted, - if is not\\r\\n\\r\\nExample: **-rwxr-xr-x**: a regular file whose user class has full permissions and whose group and others classes have only the read and execute permissions.\\r\\n\\r\\nTo represent the ***setuid***, ***setgid*** and ***sticky*** attributes, the executable character ( x or -) is modified. Though these attributes affect the overall file, not only users in one class, the ***setuid*** attribute modifies the executable character in the triad for the user, the ***setgid*** attribute modifies the executable character in the triad for the group and the ***sticky*** attribure modifies the executable character in the triad for others. For the ***setuid*** or ***setgid*** attributes, in the first or second triad, the *x* becomes *s* and the - becomes *s*. For the ***sticky*** attribute, in the third triad, the *x* becomes *t* and the - becomes *T*."},{"id":"Bienvenidos","metadata":{"permalink":"/blog/Bienvenidos","source":"@site/blog/2021-12-11-Welcome.md","title":"Bienvenidos","description":"Introducci\xf3n a la web","date":"2021-12-11T00:00:00.000Z","formattedDate":"December 11, 2021","tags":[{"label":"Spanish","permalink":"/blog/tags/spanish"},{"label":"News","permalink":"/blog/tags/news"}],"readingTime":0.635,"truncated":false,"authors":[{"name":"NENmSIS","title":"Learner","url":"https://NENmSIS.github.io","imageURL":"/img/avatargithub.jpg","key":"NENmSIS"}],"frontMatter":{"slug":"Bienvenidos","title":"Bienvenidos","authors":"NENmSIS","tags":["Spanish","News"]},"prevItem":{"title":"File-system permissions","permalink":"/blog/File-system permissions"}},"content":"## Introducci\xf3n a la web\\n\\nSi est\xe1is leyendo este post, es porque la web ya se ha publicado y el proyecto acaba de empezar. Desde este momento, todos los art\xedculos que se suban ser\xe1n parte del proyecto personal de ciberseguridad, econom\xeda e idiomas que voy a desarrollar.\\n\\nEste proyecto nace de la necesidad de documentar el progreso y los conocimientos aprendidos con el objetivo de favorecer el desarrollo de aquellas personas que puedan encontrarse en la misma situaci\xf3n. A su vez, una vez quede documentada la informaci\xf3n, su acceso reiterado se simplifica de manera significativa, permitiendo aumentar la velocidad de aprendizaje y disminuir los errores. Adem\xe1s, toda aquella informaci\xf3n adicional relativa a distintos art\xedculos creados que mejore la calidad de la informaci\xf3n expuesta, ser\xe1 a\xf1adida con posterioridad."}]}')}}]);